  true,\n\t\"url\": null,\n\t\"notes\": \"<b>Abstract:</b>  Annual average wind resource
  potential for the state of Maine at a 50 meter height.<br><br>rnrn<b>Purpose:</b>
  \ Provide information on the wind resource development potential within the state
  of Maine.<br><br>rnrn<b>Supplemental_Information:</b>  This data set has been validated
  by NREL and wind energy meteorological consultants. However, the data is not suitable
  for micro-siting potential development projects. This shapefile was generated from
  a raster dataset with a 200 m resolution, in a UTM zone 12, datum WGS 84 projection
  system.<br><br>rnrnOther_Citation_Details:  The wind power resource estimates were
  produced by AWS TrueWind using their MesoMap system and historical weather data
  under contract to Wind Powering America/NREL. This map has been validated with available
  surface data by NREL and wind energy meteorological consultants.\",\n\t\"license_title\":
